import React from "react";
import ExpenseItem from "./ExpenseItem";

export const Expenses = (props) => {
  props.items.forEach((element) => {
    console.log(element);
  });
  return (
    <div>
      {props.items.forEach((element) => {
        <ExpenseItem
          title={element.title}
          amount={element.amount}
          date={element.date}
        ></ExpenseItem>;
      })}
    </div>
  );
};
